export default class Viewstory extends Component {
    constructor(props) {
        super(props)
        this.state = {
            data: [],
            profiles: [],
            testdatas: ''
        }
    }
    getdata = async () => {
        try {
            let users = await AsyncStorage.getItem('userdatas');
            const userdatas = JSON.parse(users);
            console.log(userdatas);
            this.setState({ data: userdatas });
            const gettoken = this.state.data.token;
            const getuserid = this.state.data.userid;
            console.log(gettoken);
            const geturl = 'http://192.168.1.4:8000/api/yourstories/';
            const config = {
                headers: {
                    'content-type': 'multipart/form-data',
                    'Authorization': 'Bearer ' + gettoken,
                    'Accept': 'application/json',
                },

            };
            Axios.get(geturl + getuserid, config)
                .then(response => {
                    console.log(response);
                    // this.setState({ profiles: response.data.profile });
                })
                .catch(function (error) {
                    console.log(error);
                })
        } catch (e) {
            console.log(e);
        }
    }
    componentDidMount() {
        // setTimeout(() => {
        //   this.setState({favoritecolor: "yellow"})
        // alert('hello*********')
        this.getdata();
        const geturl = 'http://192.168.1.4:8000/api/allstories/';
        const config = {
            headers: {
                'content-type': 'multipart/form-data',
                'Authorization': 'Bearer ' + gettoken,
                'Accept': 'application/json',
            },

        };
        Axios.get(geturl,config)
            .then(response => {
                console.log(response);
                // this.setState({ profiles: response.data.profile });
            })
        }

    render() {
        return (
            <SafeAreaView style={{ flex: 1 }}>
                <View>view your story</View>
                {/* <Text>Hello {this.state.profiles.username}</Text> */}
            </SafeAreaView>
        )
    }

}
